import React from 'react'
import "./card.css"

const card = ({title, diets}) => {
  return (
    <div className='card-cont'>
      <div>
        <h4>{title}</h4>
      </div>
      <div>
        <label>Diets:</label>
        {diets?.map(d => {d.diets} )}
      </div>

    </div>
  )
}

export default card
